import Navbar from "./components/Navbar/Navbar";
import Home from "./components/Home";
import { Route } from "react-router-dom";

function App() {
  return (
    <div>
      <Navbar />
      <Home />
      <Route path="/productPage"></Route>
    </div>
  );
}

export default App;
